    - "Canoe and Kayak rentals are currently suspended to high water levels.\r\n\r\nAbout
      Alderman's Ford Regional Park\r\nThis scenic regional park includes the area
      where the Alafia River branches into its north and south prongs. The Alafia
      River is one of the most popular canoe spots in the state. \r\n\r\nSeveral picnic
      areas are connected by a pedestrian/bicycle loop path. This path, together with
      the boardwalk and foot bridges, is perfect for a self-guided tour as it provides
      a first-hand view of Hillsborough Countyâ€™s abundant flora.\r\n \r\nThe main
      picnic area has nine shelters for family or group use, and an enclosed, air
      conditioned pavilion for large gatherings. All are available for rental by calling
      813-635-3510. \r\n\r\nA pedestrian/bicycle trail loops for more than two miles
      through the park, offering scenic views of the Alafia River."
