    - true
    - "About E.G. Simmons Regional Park \r\nE.G. Simmons Park has over 7 miles of
      shoreline and has been a favorite of outdoor \r\nEnthusiasts since the mid-1960â€™s.
      The park was developed from 258 acres of native mangroves and open land areas
      intertwined with waterways. An additional 200 acres of \r\nMangrove swamp has
      been preserved as a bird sanctuary. \r\n\r\nThe Park features 18 picnic shelters,
      2 playgrounds, 2 boat launches and 700 ft of beach on beautiful Tampa Bay. The
      Park offers several fishing piers and plentiful areas for bank fishing. A canoe
      launch and trail are nestled among the waterways and mangrove islands. \r\n\r\nThe
      Park also features 2 campgrounds with 98 sites, which many have water access.
      Both areas have public restrooms, shower houses and 2 RV dump stations for your
      convenience. All campsites come with electricity, water, picnic table and fire
      ring. There are no reservations for sites, everything is done on a first-come,
      first-served basis.\r\n\r\nThe Park is open 363 days a year (closed on Thanksgiving
      and Christmas) with summer and winter hours."
