    - Edward Medard Park
    - "6140 Turkey Creek Road, Plant City, 33567\r\n\t\t\r\n"
    - 'Office:  757-3802;  Fax: 757-3939'
    - 'Spring/Summer: 6 AM - 7 PM; Fall/Winter: 6 AM - 6 PM'
    - true
    - "About Edward Medard Regional Park\r\nEdward Medard Park extends along 1,284
      acres owned by the Southwest Florida Water Management District (SWFWMD), where
      a water control structure and reservoir offer flood protection along the Alafia
      River. In 1972, under an agreement with the District, Hillsborough County developed
      this site as one of its largest and most popular regional parks. \r\n\r\nThe
      park's main attraction is a 700-acre reservoir open for canoeing, boating and
      catch and release fishing. \r\n\r\nLocated on what was once a phosphate mining
      site, the Park offers unique topography with elevation changes that have become
      very popular for childrenâ€™s play. A 3-mile trail that is accessible (dry) most
      of the year offers equestrians and hikers a pleasant trip through pine flatwoods
      and hardwood hammocks. \r\n\r\nFor overnight stays, the Park has 40 campsites
      to accommodate both RV and tent camping, including 2 Youth group sites. All
      campsites provide a picnic table, electricity, a fire ring, and water. Public
      restrooms with showers and an RV dump station are also available.  There are
      no reservations for sites, everything is done on a first-come, first-served
      basis.\r\n\r\nEdward Medard Park also offers picnic shelters, a boardwalk, a
      playground, a beach volleyball court and an observation platform overlooking
      the reservoir. \r\n\r\nUnique to Edward Medard Park is a new disc golf course.
      Although the course has not yet been dedicated, and staff are adding finishing
      touches, the course is now open to the public. Disc golf is similar in objective
      to traditional golf; the goal is to complete each hole with the fewest attempts.
      In this game, however, players throw specially made plastic flying discs at
      above ground targets instead of using clubs to direct balls to holes in the
      ground! "
