    - "Park is closed until further notice due to sinkhole activity on the site. \r\n\r\nAbout
      Lake Park\r\n\r\nLake Park offers the perfect combination of fun activities,
      excitement and breathtaking beauty. This 589-acre Park is a sanctuary for birds
      and wildlife, and features five lakes, cypress swamps, pine flatwoods, and hardwood
      hammocks. \r\n\r\nLake Park is also home to an archery range, a BMX bicycle
      track, two equestrian arenas and a radio-controlled car track, making it one
      of Hillsborough Countyâ€™s most unique Regional Parks. These facilities are open
      to the public except during races, events, and tournaments. \r\n\r\nCooperative
      partnerships with local organizations, such as the Gasparilla Bowmen Archery
      Club, Tampa BMX Raceway, Inc., and the Hurricane R/C Club, allow Hillsborough
      County to provide these high quality facilities at Lake Park. \r\n\r\nWildlife
      viewing can be enjoyed on the exercise trail or the two-mile scenic hiking trails.
      Lake Park also offers jogging paths, picnic pavilions with furnished grills,
      picnic tables, playgrounds, and primitive camping. "
