      a haven for nature study. An interpretive center, featuring exhibits, leads
      to a 3,500 ft. boardwalk and an observation tower where visitors can view an
      extensive variety of wildlife. The parks also has canoes/kayaks available for
      rent.  \r\n\r\nMore than half of the parkâ€™s property lies in the natural floodplain
      of the Hillsborough River, and consists of a hardwood swamp forest. This feature
      provides a natural storage reservoir for floodwater and improves water quality,
      acting as a biological filter to remove excess nutrients from the water. The
      remainder of the park consists of hardwood hammocks and pine flatwoods plant
      communities. \r\n\r\nFREE Guided Nature Tours\r\n\r\nLettuce Lake Parkâ€™s guided
      tours are offered Saturdays and Sundays at 8:30 AM. They take participants through
      the boardwalk and along the scenic Hillsborough River. Park rangers will highlight
      many native plants, a variety of birds, and usually even an alligator or two.
      Those bold enough to climb the three story observation tower can enjoy a scenic
      overlook from the skies. Those wishing to participate should meet inside the
      Visitor Center.\r\n\r\nIt is suggested to wear walking shoes and cool clothing,
      and carry water. Binoculars and a camera are welcome, and will definitely make
      this a memorable trip. Pets are not permitted on the boardwalk. \r\n\r\n\r\nPark
      Ranger Nature Educational Programs\r\nThis program is offered most Saturdays
      and Sundays. Participation cost is $5 per child, and children must be accompanied
      by an adult, parents or guardian. Adults without children may join for $5 â€“
      weâ€™re all kids at heart! Only cash payments are accepted at this time. "
