      the spring area\r\nSpring area will close during any kind of hazardous weather\r\nThere
      are no refunds or rain-checks for swim bands\r\n\r\nAbout Lithia Springs Regional
      Park  \r\n\r\nThe 160-acre park, located on the Alafia River, offers varied
