    - "The Upper Tampa Bay Trail is located in residential northwest Hillsborough
      County. Currently, the trail runs along the west shore of Channel A from a trailhead
      off Memorial Highway/Montague Street, past Waters Avenue, Linebaugh, and then
      due north to Gunn Highway, Ehrlich Road and ending at Peterson Road Park.  \r\n\r\nThe
      trail continues north from Van Dyke Road north and then east to the trailhead
      on Lutz Lake Fern Road, connecting to the Suncoast Trail at the Veterans Expressway.\r\n\r\nTrailheads
      and Access south to north: \r\n\r\nMemorial Trailhead:  7499 Montague Street\r\nCold
      water and parking\r\n\r\nDirections: Take Hillsborough Ave. west past the airport,
      Memorial Highway and Sheldon Road. Turn right on Montague Street.  Follow Montague
      to the trailhead a short distance on the right.\r\n\r\nChannel Park Trailhead:
      \ 9201 W. Waters Avenue \r\nRestrooms, parking, water and drink machines. \r\n\r\nDirections:
      Hillsborough Ave. West to Sheldon Road. Turn Right (north) onto Sheldon Road
      to Waters Ave. Turn left (west) onto Waters Ave. The trailhead is a very short
      distance on the right. \r\n\r\nWilsky Boulevard Trailhead:   10314 Wilsky Blvd.
      \r\nParking, cold water and restrooms \r\n\r\nDirections: From Tampa, take Waters
      Ave west to Hanley Ave. Head north on Hanley Ave, Hanley becomes Wilsky Blvd
      at Linebaugh. Cross Linebaugh, the trailhead is on the left/west side of Wilsky
      Blvd., before the on ramp to the Veterans Expressway. \r\n\r\nEhrlich Road \r\nParking,
      water, map \r\n\r\nDirections: From Tampa, take Ehrlich Road west toward Gunn
      Highway. The trail parking area is just east of Gunn Highway, south of Ehrlich,
      and adjacent to an old house.   It is not directly on the trail and could be
      easily missed. The trail is two houses to the west, just before the intersection,
      next to Bally Hoo Restaurant. The water cooler and map are just south of the
      parking along the trail. \r\n\r\nPeterson Park:  8203 Peterson Road and Rails
      Road \r\nParking, restrooms \r\n\r\nDirections: From Tampa take Gunn Highway
      north. \r\nPeterson Road is a mile north of the Gunn Highway/Sheldon Rd intersection
      at Sickles High School. Turn right onto Peterson Road. The park and the northern
      terminus of the trail are located Â½ mile on the left.\r\n\r\nLutz Lake Fern
      Trailhead:  7020 Lutz Lake Fern Road\r\nParking, restrooms\r\n\r\nDirections:
      \  On the south side of Lutz Lake Fern Road east of Gunn Highway and west of
      the Veterans Expressway."
